            if count > max_line_length:
                max_line_length, divider = count, color

    if divider is None or max_line_length < 3:
        return output.tolist()

    visited = np.zeros((rows, cols), dtype=bool)

    def flood_fill(sr, sc):
        if visited[sr, sc] or grid[sr, sc] == divider:
            return []
        region = []
        queue = deque([(sr, sc)])
        visited[sr, sc] = True
        while queue:
            r, c = queue.popleft()
            region.append((r, c))
