    regions = [r for r in regions if r]

    for region in regions:
        region_set = set(region)
        boundary = set()
        for r, c in region:
            is_boundary = (r == 0 or r == rows - 1 or c == 0 or c == cols - 1)
            if not is_boundary:
                for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                    if grid[r + dr, c + dc] == divider:
                        is_boundary = True
                        break
            if is_boundary:
