        distances = {(r, c): 0 for r, c in boundary}
        queue = deque(boundary)
        while queue:
            r, c = queue.popleft()
            for dr, dc in [(-1, 0), (1, 0), (0, -1), (0, 1)]:
                nr, nc = r + dr, c + dc
                if (nr, nc) in region_set and (nr, nc) not in distances:
                    distances[(nr, nc)] = distances[(r, c)] + 1
                    queue.append((nr, nc))

        markers = {}
        for r, c in region:
            if grid[r, c] != background:
                d = distances.get((r, c), 0)
                if d not in markers:
                    markers[d] = grid[r, c]

        if not markers:
            continue

        sorted_dists = sorted(markers.keys())
        color_list = [background] if 0 not in markers else []
        for d in sorted_dists:
            color_list.append(markers[d])

        for r, c in region:
            d = distances.get((r, c), 0)
            output[r, c] = color_list[d % len(color_list)]

    return output.tolist()
